import React, {useState} from "react";

function Example() {
    const [count, setCount] = useState(0);

    return (
        <div>
            <p>Вы нажали {count} раз.</p>
            <button onClick={() => setCount(count + 1)}>
                Нажми еще разик.
            </button>
            <button onClick={() => setCount(0)}>
                Сбросить счет
            </button>
        </div>
    );
}

export default Example;
